INSERT INTO `collections` (`id`, `title`, `description`, `cover_image`, `genre`, `created_at`) VALUES
(17, 'Spider Man', 'After being bitten by a radioactive spider, teenager Peter Parker gains superhuman strength, agility, and the ability to cling to walls. As the masked hero Spider-Man, he protects New York City from dangerous villains while navigating the struggles of his personal life, learning that with great power comes great responsibility.', 'https://zinema.lk/uploads/694eeccda6bc2_collection_{fbb06c2b69d311108ea04f77ab656752}.jpg', 'Action, Sci-Fi, Romance', '2025-12-26 20:15:09'),
(18, 'Diary of a Wimpy Kid', 'A hilarious series of journals written by Greg Heffley, a middle school student trying to navigate the hazards of growing up. He deals with bullies, friends, and family while attempting to climb the popularity ladder, often with disastrous and funny results', 'https://zinema.lk/uploads/694eefe142ef5_collection_{c78e5a6eca8fd6c6b45487fd4046a1dc}.jpg', 'Comedy', '2025-12-26 20:28:17'),
(19, 'Home Alone', 'A classic holiday comedy series that follows the misadventures of childrenmost notably Kevin McCallisterwho are accidentally left behind by their families during Christmas. Left to their own devices, they must protect their homes from bumbling burglars using a series of creative, elaborate, and hilarious booby traps.', 'https://zinema.lk/uploads/6959507c5a028_collection_{4e278d8db6710b3735140c5dcf4f3f71}.jpg', 'Comedy, Action, Drama', '2026-01-03 17:23:08'),
(20, 'How to Train Your Dragon', 'A young Viking befriends a rare dragon, changing the fate of his village forever through epic adventures.', 'https://zinema.lk/uploads/69625d078235e_collection_How to Train Your Dragon 3-Movie Collection DVD {1a895917db7e417d35a50b07e1563843}.jpg', 'Action, Sci-Fi, Drama', '2026-01-10 14:07:03'),
(21, 'Garfield', 'Follow the hilarious life of a lasagna-loving cat who hates Mondays and loves napping.', 'https://zinema.lk/uploads/69625f7ce07d2_collection_81k1UKhWhhL._AC_UF894,1000_QL80_.jpg', 'Comedy', '2026-01-10 14:17:32'),
(22, 'Dr. Dolittle', 'A doctor discovers he has the extraordinary ability to talk to animals and help them.', 'https://zinema.lk/uploads/696260df71c63_collection_61ipDSoniaL._AC_UF894,1000_QL80_.jpg', 'Comedy, Action', '2026-01-10 14:23:27'),
(23, 'Harry Potter', 'A young wizard and his friends battle dark forces while attending a secret school of magic.', 'https://zinema.lk/uploads/696261f165950_collection_harry_potter_8film_2000x3000.jpg', 'Action, Drama, Thriller', '2026-01-10 14:28:01'),
(26, 'Jurassic Park', 'A wealthy entrepreneur invites a group of experts to preview a unique theme park on a remote island featuring living dinosaurs created from prehistoric DNA. However, the wondrous tour turns into a nightmare when a power failure allows the cloned predators to break loose, forcing the visitors to fight for their survival.', 'https://zinema.lk/uploads/69745309769f6_collection_{0141b0bea5ac862b718cdae537356123}.jpg', 'Action, Sci-Fi, Thriller', '2026-01-24 04:59:21'),
(27, 'Jurassic World', 'Decades after the original disaster, Isla Nublar now hosts a fully functioning dinosaur theme park called Jurassic World. However, chaos erupts when a genetically modified hybrid dinosaur, the Indominus Rex, escapes containment and goes on a rampage, forcing the park\'s staff and visitors to fight for survival.', 'https://zinema.lk/uploads/697457de1f8f3_collection_{56724c607a275d283e6d521bb1fd5bee}.jpg', 'Action, Sci-Fi, Thriller', '2026-01-24 05:25:50'),
(28, 'Jumanji', 'When a mysterious game is discovered, players find themselves thrust into a perilous world of jungles, wild animals, and dangerous traps. Whether playing a board game that brings creatures into the real world or getting sucked into a video game avatar, the players must face their fears and finish the game to survive.', 'https://zinema.lk/uploads/69745fd027140_collection_{d764616d3a51de0be543cea2c0da55c6}.jpg', 'Action, Comedy, Thriller', '2026-01-24 05:59:44'),
(29, 'Venom', 'Investigative journalist Eddie Brock attempts to revive his career by investigating the Life Foundation, but inadvertently merges with a symbiotic alien named Venom. Together, they share a body and form a super-powered anti-hero, struggling to control their violent impulses while protecting the world from other alien threats.', 'https://zinema.lk/uploads/6974660e05934_collection_{e9ff31b81734e01464c28c46d475e2df}.jpg', 'Action, Sci-Fi, Comedy, Thriller', '2026-01-24 06:26:22'),
(30, 'Pacific Rim', 'When legions of monstrous creatures, known as Kaiju, rise from the sea, humanity initiates a war for survival. To fight them, humans build massive robots called Jaegers, which are controlled simultaneously by two pilots whose minds are locked in a neural bridge. As the attacks grow stronger, a washed-up pilot and a trainee team up to pilot a legendary Jaeger in a last-ditch effort to save the world.', 'https://zinema.lk/uploads/6975d1a045bcf_collection_Pacific Rim {81aa41e7d20490cd258487659f17ccdd}.jpg', 'Action, Sci-Fi', '2026-01-25 08:17:36');
