INSERT INTO `episodes` (`id`, `series_id`, `season_number`, `episode_number`, `title`, `description`, `video_url`, `views`, `thumb_image`, `air_date`, `duration`, `created_at`) VALUES
(72, 5, 1, 1, 'The First Encounter', 'Captain Yoo Si-jin and Sergeant Major Seo Dae-young catch a motorcycle thief on their day off. This leads them to the hospital where Si-jin meets Dr. Kang Mo-yeon for the first time and falls for her immediately, though she mistakes him for a criminal.', 'https://my-drive-streamer.indrasankag.workers.dev/1jAwx-ZctHBt1JXK1VqVFZ_xqH8FPgfmZ', 0, 'https://sinhalamovies.web.lk/uploads/696349cb1184c_thumb_1734421526628-i.webp', '2016-02-24', 60, '2025-12-26 21:08:41'),
(73, 6, 1, 1, 'The Encounter After 400 Years', 'Do Min-joon is an alien who landed on Earth in 1609 and has lived there for 400 years. With only three months left before his long-awaited departure to his home planet, his quiet life is interrupted when the famous but unpredictable actress Cheon Song-yi becomes his next-door neighbor.', 'https://my-drive-streamer.indrasankag.workers.dev/1ZI9eV9srZa5U1TeE4u6_nomZPsM3WSbj', 0, 'https://sinhalamovies.web.lk/uploads/694efec7177fa_thumb_{594b650921c37679fa9bf84e62f8fbc7}.jpg', '2013-12-18', 60, '2025-12-26 21:31:51'),
(75, 9, 1, 1, 'Winter Is Coming', 'Lord Ned Stark is torn between his family and duty when King Robert Baratheon arrives at Winterfell to appoint him as his new Hand. Meanwhile, across the Narrow Sea, the exiled Viserys Targaryen forges an alliance with a Dothraki warlord by arranging a marriage for his sister Daenerys to reclaim the Iron Throne.', 'https://my-drive-streamer.indrasankag.workers.dev/1buj4Ti0FTJ0hJl3qKAjEr2zWEr28iQDQ', 0, 'https://sinhalamovies.web.lk/uploads/6962d0511aca2_thumb_{5ce4243acde6e23b5b8ba0681f9edd7b}.jpg', '2011-04-17', 62, '2025-12-26 21:38:17'),
