(85, 10, 1, 1, 'The Rooftop Rescue', 'Geum Jan-di, a delivery girl for her family\'s dry-cleaning business, visits the elite Shinhwa High School. She saves a student from a suicide attempt caused by the F4\'s bullying, making her an overnight sensation.', 'https://my-drive-streamer.indrasankag.workers.dev/18K9Gsp93MN1cjJVS5g8nO-3-H6BGp_0V', 0, 'https://sinhalamovies.web.lk/uploads/6962c7183bd69_thumb_25 increibles doramas que no te puedes perder {ca9d3966d226ac2d973ddc88f09992bb}.jpg', '2009-01-05', 15, '2026-01-10 21:39:36'),
(86, 10, 1, 2, 'The Shinhwa Scholarship', 'To quiet public backlash, the Shinhwa Group offers Jan-di a scholarship. Though reluctant, she joins the school to please her family and is immediately stunned by the school\'s overwhelming wealth.', 'https://my-drive-streamer.indrasankag.workers.dev/1McRdPA0rDwc29nZ4azGoJKxznImM7Xjs', 0, 'https://sinhalamovies.web.lk/uploads/6962c823148b7_thumb_25 increibles doramas que no te puedes perder {ca9d3966d226ac2d973ddc88f09992bb}.jpg', '2009-01-05', 15, '2026-01-10 21:44:03'),
(87, 10, 1, 3, 'A Mysterious Melody', 'Jan-di gets lost on campus and encounters the mysterious Yoon Ji-hoo playing his violin in the woods. Later, she meets the F4 in person and witnesses Gu Jun-pyos arrogant behavior toward other students.', 'https://my-drive-streamer.indrasankag.workers.dev/1iF1z1GAV9aZGHjwSDCPwEj10s25R-Emb', 0, 'https://sinhalamovies.web.lk/uploads/6962c844c3452_thumb_25 increibles doramas que no te puedes perder {ca9d3966d226ac2d973ddc88f09992bb}.jpg', '2009-01-05', 15, '2026-01-10 21:44:36'),
(88, 10, 1, 4, 'The Declaration of War', 'Witnessing Jun-pyos cruelty toward her new friend Min-ji, Jan-di finally snaps. She publicly stands up to the F4 leader, effectively declaring war on the school\'s most powerful group.', 'https://my-drive-streamer.indrasankag.workers.dev/1dWLBfw-nw0XAjn93Qi-oAXRdjFdEPrBf', 0, 'https://sinhalamovies.web.lk/uploads/6962c86471deb_thumb_25 increibles doramas que no te puedes perder {ca9d3966d226ac2d973ddc88f09992bb}.jpg', '2009-01-05', 15, '2026-01-10 21:45:08'),
(89, 10, 1, 5, 'The Red Card Target', 'Jan-di receives the dreaded \"Red Card\" in her locker. The entire school begins to bully her, but Jan-dis resilience captures the attention of both the soft-spoken Ji-hoo and the arrogant Jun-pyo.', 'https://my-drive-streamer.indrasankag.workers.dev/1n9saD1Jzc3sGYwVt_DLN6qR81Su_Myz1', 0, 'https://sinhalamovies.web.lk/uploads/6962c87986deb_thumb_25 increibles doramas que no te puedes perder {ca9d3966d226ac2d973ddc88f09992bb}.jpg', '2009-01-06', 15, '2026-01-10 21:45:29'),
(90, 10, 1, 6, 'Malicious Rumors', 'A vicious rumor spreads that Jan-di is pregnant. Pushed to her limit, she confronts Jun-pyo at the school lockers and delivers a flying kick to his face, shocking everyone who expected her to beg for mercy.', 'https://my-drive-streamer.indrasankag.workers.dev/1_MppJqwaqkntkycv_YSo3CTfpPMTxKYf', 0, 'https://sinhalamovies.web.lk/uploads/6962c94a0305d_thumb_25 increibles doramas que no te puedes perder {ca9d3966d226ac2d973ddc88f09992bb}.jpg', '2009-01-06', 15, '2026-01-10 21:48:58'),
(91, 10, 1, 7, 'A King\'s Ransom', 'Jun-pyo \"kidnaps\" Jan-di and brings her to his mansion for a total makeover. He tries to buy her affection with expensive gifts, but Jan-di rejects his status, telling him that money cannot buy everything.', 'https://my-drive-streamer.indrasankag.workers.dev/1JnPiQvrM_a9kPvdUk8Zz4simXSk-H0hN', 0, 'https://sinhalamovies.web.lk/uploads/6962c98cbb138_thumb_25 increibles doramas que no te puedes perder {ca9d3966d226ac2d973ddc88f09992bb}.jpg', '2009-01-06', 15, '2026-01-10 21:50:04'),
(92, 10, 1, 8, 'The First Rivalry', 'Jan-di is injured during a dodgeball game. Jun-pyo clumsily tries to help her, but his pride causes them to clash again. Meanwhile, Jan-dis admiration for Ji-hoo grows as she learns more about his lonely past.', 'https://my-drive-streamer.indrasankag.workers.dev/1OE1dDdjqSVy8gtTxaXIdt_ABeHTFi0CQ', 0, 'https://sinhalamovies.web.lk/uploads/6962c9d846b32_thumb_25 increibles doramas que no te puedes perder {ca9d3966d226ac2d973ddc88f09992bb}.jpg', '2009-01-06', 15, '2026-01-10 21:51:20'),
(93, 10, 1, 9, 'Return of the First Love', 'Ji-hoos first love, the famous model Min Seo-hyun, returns from France. Jan-di feels a pang of jealousy and insecurity as she watches the close bond between Ji-hoo and the accomplished Seo-hyun.', 'https://my-drive-streamer.indrasankag.workers.dev/1bfneTVb-HTUsPliHxF2yEiY4pXuzaF8U', 0, 'https://sinhalamovies.web.lk/uploads/6962ca0e8f920_thumb_25 increibles doramas que no te puedes perder {ca9d3966d226ac2d973ddc88f09992bb}.jpg', '2009-01-06', 15, '2026-01-10 21:52:14'),
(94, 10, 1, 10, 'The Costume Party Trap', 'Mean girls trick Jan-di into wearing a Wonder Woman costume to a formal party. She is publicly humiliated until Seo-hyun and Ji-hoo intervene, helping her stand tall against the bullies.', 'https://my-drive-streamer.indrasankag.workers.dev/10j_S1Ck0R31MLpcTjeqNefl5wg4NGIZc', 0, 'https://sinhalamovies.web.lk/uploads/6962ca49ac4d8_thumb_25 increibles doramas que no te puedes perder {ca9d3966d226ac2d973ddc88f09992bb}.jpg', '2009-01-06', 14, '2026-01-10 21:53:13'),
(95, 9, 1, 2, 'The Road South', 'The Starks divide as Ned travels south to the capital and Jon Snow heads north to the Wall. Conflict erupts between Arya and Prince Joffrey, leading to a tragic sacrifice that marks the end of innocence for the Stark children.', 'https://my-drive-streamer.indrasankag.workers.dev/1DD9_kE7KBd_4nqcVHT3xgmw5LLugxwfG', 0, 'https://sinhalamovies.web.lk/uploads/6962d1fe037d0_thumb_{5ce4243acde6e23b5b8ba0681f9edd7b}.jpg', '2011-04-24', 56, '2026-01-10 22:26:06'),
(96, 9, 1, 3, 'Arrival at Court', 'Ned arrives at Kings Landing and realizes the city is a den of corruption. At the Wall, Jon struggles to fit in with his new brothers. Across the sea, Daenerys begins to find her voice and stands up to her brother Viserys.', 'https://my-drive-streamer.indrasankag.workers.dev/1h6aI1GvgSWWO4beaMLK1FawRB7PEG6MN', 0, 'https://sinhalamovies.web.lk/uploads/6962d223e3622_thumb_{5ce4243acde6e23b5b8ba0681f9edd7b}.jpg', '2011-05-01', 58, '2026-01-10 22:26:43'),
(97, 9, 1, 4, 'Seeds of Treason', 'Ned investigates the suspicious death of the previous Hand of the King, uncovering a dangerous secret. Samwell Tarly joins the Night\'s Watch, and Catelyn makes a bold move by arresting Tyrion Lannister on suspicion of murder.', 'https://my-drive-streamer.indrasankag.workers.dev/14aKJvYuDLik9LSwld4x505IEx_HyHlfm', 0, 'https://sinhalamovies.web.lk/uploads/6962d251ccc55_thumb_{5ce4243acde6e23b5b8ba0681f9edd7b}.jpg', '2011-05-08', 56, '2026-01-10 22:27:29'),
(98, 9, 1, 5, 'The Lion vs. The Wolf', 'Tensions between the Starks and Lannisters reach a breaking point. Ned refuses to participate in a plot to assassinate Daenerys, leading to a violent street confrontation with Jaime Lannister that leaves Ned wounded.', 'https://my-drive-streamer.indrasankag.workers.dev/1CygquCeySGDqsqZ0Alw1Kbv4tWweeXL1', 0, 'https://sinhalamovies.web.lk/uploads/6962d292c07d4_thumb_{5ce4243acde6e23b5b8ba0681f9edd7b}.jpg', '2011-05-15', 55, '2026-01-10 22:28:34'),
(99, 9, 1, 6, 'The Golden Crown', 'While Ned governs from the Iron Throne, he sentences a powerful Lannister ally to death. In the East, Viserys\'s obsession with a crown leads to a gruesome end at the hands of Khal Drogo in a \"golden\" coronation.', 'https://my-drive-streamer.indrasankag.workers.dev/1GktADKcKWF9KUIwNkr3XJeh-k0IF0UMN', 0, 'https://sinhalamovies.web.lk/uploads/6962d320431bf_thumb_{5ce4243acde6e23b5b8ba0681f9edd7b}.jpg', '2011-05-22', 53, '2026-01-10 22:30:56'),
(100, 9, 1, 7, 'Playing the Game', 'Ned confronts Queen Cersei with the truth about her children, giving her a chance to flee. However, his mercy is met with betrayal when King Robert dies and Littlefinger chooses a side in the struggle for power.', 'https://my-drive-streamer.indrasankag.workers.dev/1uMAXFOqRWTAAoEwR7WHjrdZTGMkU55ow', 0, 'https://sinhalamovies.web.lk/uploads/6962d37a7037e_thumb_{5ce4243acde6e23b5b8ba0681f9edd7b}.jpg', '2011-05-29', 58, '2026-01-10 22:32:26'),
(101, 9, 1, 8, 'The Stark Rebellion', 'Following Ned\'s arrest, the Lannisters purge the Stark household. Arya escapes into the streets of King\'s Landing, while Robb Stark calls his banners to war, rallying the North to rescue his father and sisters.', 'https://my-drive-streamer.indrasankag.workers.dev/1X50ka7uWhXwlBjGF2KsxzuWcmhTZjCC0', 0, 'https://sinhalamovies.web.lk/uploads/6962d3a712592_thumb_{5ce4243acde6e23b5b8ba0681f9edd7b}.jpg', '2011-06-05', 59, '2026-01-10 22:33:11'),
(102, 9, 1, 9, 'The Ultimate Sacrifice', 'In a desperate attempt to save his daughters, Ned Stark makes a public confession of treason. Despite a promise of mercy, the sadistic King Joffrey makes a shocking decision that changes the fate of the realm forever.', 'https://my-drive-streamer.indrasankag.workers.dev/17FPDlgkw8pXsmyW_llu0Uo-pR8GbCns6', 0, 'https://sinhalamovies.web.lk/uploads/6962d3cfc086a_thumb_{5ce4243acde6e23b5b8ba0681f9edd7b}.jpg', '2011-06-12', 57, '2026-01-10 22:33:51'),
(103, 9, 1, 10, 'Fire and Blood', 'The North proclaims Robb Stark their King. As the Starks mourn their loss, Daenerys steps into a funeral pyre with her dragon eggs. By morning, a new power is born into the world amidst the ashes.', 'https://my-drive-streamer.indrasankag.workers.dev/1f6j020rstrketCA2TRlWiP-Pq3qJhWwQ', 0, 'https://sinhalamovies.web.lk/uploads/6962d3fa34c47_thumb_{5ce4243acde6e23b5b8ba0681f9edd7b}.jpg', '2011-06-19', 53, '2026-01-10 22:34:34'),
(104, 9, 2, 1, 'The Vow of Revenge', 'Tyrion arrives at King\'s Landing to serve as Hand of the King, much to Cersei\'s dismay. At Dragonstone, Stannis Baratheon publicly claims the Iron Throne, declaring Joffrey a bastard and allying with the mysterious priestess Melisandre. In the capital, Joffrey orders a brutal purge of all King Robert\'s illegitimate children. Meanwhile, Robb Stark continues his war in the North, and Daenerys leads her starving followers through the Red Waste.', 'https://my-drive-streamer.indrasankag.workers.dev/18mG6J7iFPehBI80TcJ2R7iPlxhaPi817', 0, 'https://sinhalamovies.web.lk/uploads/6962d4ecd347e_thumb_Screenshot 2026-01-11 040803.png', '2012-04-01', 52, '2026-01-10 22:38:36'),
