INSERT INTO `series` (`id`, `title`, `release_date`, `genre`, `description`, `cover_image`, `language_type`, `created_at`) VALUES
(5, 'Descendants of the Sun [  ]', '2016', 'Romance, Drama, Action', 'The story follows a passionate romance between an elite Special Forces Captain, Yoo Shi-jin, and a capable surgeon, Kang Mo-yeon. Their differing views on lifeone who kills to protect and one who saves lives at all costschallenge their initial relationship. They are unexpectedly reunited when both are deployed to a fictional war-torn country, where their love deepens as they navigate conflict, natural disasters, and epidemics.', 'uploads/694ef86cca51a_{01ec8cbfbd5620b77b8ebcee2705a80b}.jpg', 'dubbed', '2025-12-26 21:04:44'),
(6, 'My Love from the Star [     ]', '2013', 'Romance, Comedy, Drama', 'Do Min-joon is an alien who landed on Earth 400 years ago during the Joseon Dynasty. He possesses a near-perfect appearance and enhanced physical abilities. As he prepares to return to his home planet after four centuries, he meets the famous and chaotic actress Cheon Song-yi and falls in love.', 'uploads/694efb1d20dd0_{ec7a552a7057864fbaa0c70befc48d01}.jpg', 'dubbed', '2025-12-26 21:16:13'),
(9, 'Game of Thrones', '2011', 'Action, Drama, Thriller, Romance', 'Nine noble families fight for control over the lands of Westeros, while an ancient enemy returns after being dormant for a millennia. As conflicts erupt among the kingdoms of men, the Night\'s Watch protects the realm from the icy horrors beyond the northern Wall.', 'uploads/694efda257e32_{23222067626dd970dd22cf2b488655a5}.jpg', 'subtitled', '2025-12-26 21:26:58'),
(10, 'Boys Over Flowers', '2009', 'Romance, Comedy, Drama', 'Enter this summary: Geum Jan-di, a girl from a working-class family, unexpectedly receives a scholarship to the ultra-elite Shinhwa High School. There, she encounters the \"F4\"a group of four rich, handsome, and arrogant boys who rule the school through bullying. When Jan-di stands up to their leader, Gu Jun-pyo, she becomes the target of their \"red card\" harassment. However, her resilience captures Jun-pyo\'s heart, leading to a complicated love triangle and a battle against deep social and economic divides.', 'uploads/6962c4617a2cc_{935b6ef48a363e3ece637e72eda1b5ff}.jpg', 'dubbed', '2026-01-10 21:28:01'),
(11, 'Lucifer', '2016', 'Drama, Comedy, Thriller', 'The Devil moves to Los Angeles, opens a nightclub, and begins helping the police solve crimes.', 'uploads/696357d302cc4_{071252ac4197a572ebbfab8a28b7886d} (1).jpg', 'subtitled', '2026-01-11 07:54:30'),
(12, 'Legend of the Seeker [   ]', '2008', 'Action, Drama', 'A woodsman turns hero to stop a ruthless tyrant from conquering the world with dark magic.', 'uploads/69635b0d7d05d_{f909f51b157724b15da505b1c3825791}.jpg', 'dubbed', '2026-01-11 08:10:53');
